import React from 'react';
import Button from 'react-bootstrap/Button';

const HomePage = () => {

const deneme = () => {
    console.log("tıklama başarılı");
}

return (
  <div>
        <Button variant="secondary" size="lg" onClick={deneme}>SERIES</Button> 
        <p> Ppopular Series  </p>
        <Button variant="primary" onClick={deneme}>MOVIES</Button> 
        <p> Popular Movies</p>

        </div>
    
);

}

export default HomePage;
